import React from 'react'
import './Intro.css'

function Intro() {
    const shiftLeftDiv = document.getElementById('shift-left-div');

    shiftLeftButton.addEventListener('click', () => {
        shiftLeftDiv.style.transform = 'translateX(-100%)';
    });

  return (
    <div className='Intro-Holder'>
        <div className='Intro-Center-Holder'>
            <div className='Intro-Center'>
                <div className='Intro-Text'>
                    <h5>Entrepreneur • Software Engineer • Consultant</h5>
                </div>
            </div>
            <div className='Intro-Title'>
                <h1>CAMERON <br/> SAIDOCK</h1>
            </div>
        </div>
    </div>
  )
}

export default Intro
